PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE videos (
  Id TEXT,
  Family TEXT,
  Type TEXT,
  Session INTEGER,
  Video TEXT,
  Timestamp TEXT,
  Parent_Strategy TEXT,
  Fidelity INTEGER,
  Child_Communication TEXT,
  Reading_Technique TEXT,
  Child_response_to_RT TEXT,
  Comments TEXT,
  if_second INTEGER,
  transcript TEXT,
  ASR TEXT,
  start_time TEXT,
  end_time TEXT,
  matched_transcript TEXT,
  Clip_Name TEXT,
  Gesture_label TEXT,
  PRIMARY KEY (Id)
);
CREATE TABLE file_sessions (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      family TEXT NOT NULL,
      type TEXT NOT NULL,
      session TEXT NOT NULL,
      UNIQUE(family, type, session)
    );
CREATE TABLE passcodes (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    code TEXT NOT NULL,
    userId TEXT NOT NULL,
    generateAt TEXT NOT NULL,
    numUsed INTEGER DEFAULT 0
  );
CREATE TABLE applications (
            id INTEGER PRIMARY KEY AUTOINCREMENT,
            name TEXT NOT NULL,
            email TEXT NOT NULL,
            purpose TEXT NOT NULL,
            disclaimerAgreed BOOLEAN NOT NULL,
            createdAt DATETIME DEFAULT CURRENT_TIMESTAMP);
DELETE FROM sqlite_sequence;
COMMIT;
